import React, { useContext, useState, useMemo } from 'react';
import { 
  Container, 
  Typography, 
  Table, 
  TableHead, 
  TableRow, 
  TableCell, 
  TableBody, 
  Button, 
  Paper, 
  Box, 
  TextField,
  Grid,
  Divider,
  Tabs,
  Tab,
  Chip
} from '@mui/material';
import { TokenContext } from '../context/TokenContext';
import { useTheme } from '@mui/material/styles';
import MaleIcon from '@mui/icons-material/Male';
import FemaleIcon from '@mui/icons-material/Female';

const AdminPanel = () => {
  const theme = useTheme();
  const { 
    tokens, 
    serveToken, 
    getCurrentToken, 
    setCurrentToken,
    getRecentToken 
  } = useContext(TokenContext);

  const [maleToken, setMaleToken] = useState(getCurrentToken('male') || '');
  const [femaleToken, setFemaleToken] = useState(getCurrentToken('female') || '');
  const [activeTab, setActiveTab] = useState(0);

  // Separate tokens by gender
  const { maleTokens, femaleTokens } = useMemo(() => {
    return tokens.reduce((acc, token) => {
      if (token.tokenId && token.tokenId.startsWith('M')) {
        acc.maleTokens.push(token);
      } else if (token.tokenId && token.tokenId.startsWith('F')) {
        acc.femaleTokens.push(token);
      } else if (token.gender === 'male') {
        acc.maleTokens.push({ ...token, tokenId: `M${token.tokenNumber}` });
      } else {
        acc.femaleTokens.push({ ...token, tokenId: `F${token.tokenNumber}` });
      }
      return acc;
    }, { maleTokens: [], femaleTokens: [] });
  }, [tokens]);

  const handleSetToken = (gender) => {
    const tokenValue = gender === 'male' ? maleToken : femaleToken;
    setCurrentToken(gender, parseInt(tokenValue) || 0);
  };

  const handleTabChange = (event, newValue) => {
    setActiveTab(newValue);
  };

  const renderTokenTable = (tokenList, gender) => (
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>Token</TableCell>
          <TableCell>Name</TableCell>
          <TableCell>Service</TableCell>
          <TableCell>Mobile</TableCell>
          <TableCell>Status</TableCell>
          <TableCell>Action</TableCell>
        </TableRow>
      </TableHead>
      <TableBody>
        {tokenList.length > 0 ? (
          tokenList.map((t) => (
            <TableRow 
              key={t.tokenNumber} 
              sx={{ 
                bgcolor: t.served ? 'grey.100' : 'inherit',
                '&:hover': {
                  backgroundColor: 'action.hover',
                },
              }}
            >
              <TableCell>
                <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                  {gender === 'male' ? (
                    <MaleIcon color="primary" fontSize="small" />
                  ) : (
                    <FemaleIcon color="secondary" fontSize="small" />
                  )}
                  <span>{t.tokenId || (gender === 'male' ? 'M' : 'F') + t.tokenNumber}</span>
                </Box>
              </TableCell>
              <TableCell>{t.name}</TableCell>
              <TableCell>{t.service}</TableCell>
              <TableCell>{t.mobile}</TableCell>
              <TableCell>
                <Chip 
                  label={t.served ? 'Served' : 'Waiting'} 
                  color={t.served ? 'default' : 'primary'}
                  size="small"
                  variant={t.served ? 'outlined' : 'filled'}
                />
              </TableCell>
              <TableCell>
                {!t.served && (
                  <Button 
                    variant="contained" 
                    size="small" 
                    onClick={() => serveToken(t.tokenNumber, gender)}
                    color={gender === 'male' ? 'primary' : 'secondary'}
                    sx={{ minWidth: 90 }}
                  >
                    Serve
                  </Button>
                )}
              </TableCell>
            </TableRow>
          ))
        ) : (
          <TableRow>
            <TableCell colSpan={6} align="center" sx={{ py: 3 }}>
              <Typography variant="body2" color="text.secondary">
                No {gender} tokens in the queue
              </Typography>
            </TableCell>
          </TableRow>
        )}
      </TableBody>
    </Table>
  );

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 6 }}>
      <Paper elevation={3} sx={{ p: 4, mb: 4, borderRadius: 4 }}>
        <Typography variant="h4" gutterBottom sx={{ 
          textAlign: 'center',
          background: 'linear-gradient(45deg, #33126B 30%, #FF0A91 90%)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent',
          mb: 4
        }}>
          Admin Control Panel
        </Typography>

        {/* Current Tokens Control */}
        <Box sx={{ mb: 4 }}>
          <Typography variant="h6" gutterBottom>Current Serving Tokens</Typography>
          <Divider sx={{ mb: 3 }} />
          <Grid container spacing={3}>
            <Grid item xs={12} md={6}>
              <Paper elevation={2} sx={{ p: 3, borderRadius: 3, bgcolor: 'rgba(51, 18, 107, 0.05)' }}>
                <Typography variant="subtitle1" color="primary" gutterBottom>♂ Male Counter</Typography>
                <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
                  <TextField
                    type="number"
                    size="small"
                    label="Token #"
                    value={maleToken}
                    onChange={(e) => setMaleToken(e.target.value)}
                    sx={{ flex: 1 }}
                  />
                  <Button 
                    variant="contained" 
                    color="primary"
                    onClick={() => handleSetToken('male')}
                    sx={{ minWidth: 100 }}
                  >
                    Set
                  </Button>
                </Box>
                <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                  Current: M{getCurrentToken('male') || '0'}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} md={6}>
              <Paper elevation={2} sx={{ p: 3, borderRadius: 3, bgcolor: 'rgba(255, 10, 145, 0.05)' }}>
                <Typography variant="subtitle1" color="secondary" gutterBottom>♀ Female Counter</Typography>
                <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
                  <TextField
                    type="number"
                    size="small"
                    label="Token #"
                    value={femaleToken}
                    onChange={(e) => setFemaleToken(e.target.value)}
                    sx={{ flex: 1 }}
                  />
                  <Button 
                    variant="contained" 
                    color="secondary"
                    onClick={() => handleSetToken('female')}
                    sx={{ minWidth: 100 }}
                  >
                    Set
                  </Button>
                </Box>
                <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
                  Current: F{getCurrentToken('female') || '0'}
                </Typography>
              </Paper>
            </Grid>
          </Grid>
        </Box>

        <Box sx={{ mt: 4 }}>
          <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
            <Typography variant="h6">Token Queues</Typography>
            <Tabs 
              value={activeTab} 
              onChange={handleTabChange}
              sx={{ minHeight: 40 }}
            >
              <Tab 
                label={
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <MaleIcon color={activeTab === 0 ? 'primary' : 'action'} />
                    <span>Male ({maleTokens.filter(t => !t.served).length})</span>
                  </Box>
                }
                sx={{ minHeight: 40 }}
              />
              <Tab 
                label={
                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                    <FemaleIcon color={activeTab === 1 ? 'secondary' : 'action'} />
                    <span>Female ({femaleTokens.filter(t => !t.served).length})</span>
                  </Box>
                }
                sx={{ minHeight: 40 }}
              />
            </Tabs>
          </Box>

          <Divider sx={{ mb: 3 }} />

          <Paper elevation={2} sx={{ borderRadius: 3, overflow: 'hidden' }}>
            {activeTab === 0 ? (
              <Box>
                <Box sx={{ p: 2, bgcolor: 'primary.main' }}>
                  <Typography variant="subtitle1" color="white">
                    Male Token Queue
                  </Typography>
                </Box>
                <Box sx={{ overflowX: 'auto' }}>
                  {renderTokenTable(maleTokens, 'male')}
                </Box>
              </Box>
            ) : (
              <Box>
                <Box sx={{ p: 2, bgcolor: 'secondary.main' }}>
                  <Typography variant="subtitle1" color="white">
                    Female Token Queue
                  </Typography>
                </Box>
                <Box sx={{ overflowX: 'auto' }}>
                  {renderTokenTable(femaleTokens, 'female')}
                </Box>
              </Box>
            )}
          </Paper>
        </Box>
      </Paper>
    </Container>
  );
};

export default AdminPanel;
